import React, { Component } from "react";

class Car extends Component {
    render() {
        return (
            <div>
                <h2>{this.props.car.manufacturer} {this.props.car.name}</h2>
                <h2>{this.props.car.horsepower} bhp</h2>
            </div>
        );
    }
}
